import React from 'react';

import axios from 'axios';

 class PersonList  {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.get(`/api/corona2`)
      .then(res => {
        const persons = res.data;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <ul>
        { this.state.persons.map(person => <li>{person.Country}</li>)}
      </ul>
    )
  }
}
export default PersonList;
